INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (4, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si, riceverai notifica della fattura al tuo indirizzo email. E'' possibile inoltre consultare "Documenti e fatture" nella pagina "il mio account" per avere accesso allo storico delle tue fatture in ogni momento.', 'GENERAL', 'it', 'E'' prevista l''emissione di una fattura al termine della transazione?', 'fattura, fatturazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (5, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Durante l''accesso, seleziona il tasto "reimposta password" e ti verrÃ  immediatamente inoltrata una nuova password al tuo indirizzo email registrato. Segui poi le istruzioni per impostare una nuova password a tua scelta.', 'GENERAL', 'it', 'Ho dimenticato la password di accesso al sito, come posso recuperarla?', 'password, reimposta password, password smarrita');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (6, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dal pannello "il mio account", seleziona "dati personali" e poi modifica il campo che ti interessa. Tuttavia non sarÃ  possibile modificare i dati predefiniti relativi al pagamento mentre una transazione Ã¨ ancora in corso.', 'GENERAL', 'it', 'Come posso modificare i miei dati personali?', 'dati personali, modifica intestazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (7, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'E'' possibile effettuare e ricevere pagamenti tramite bonifico bancario o tramite account Paypal. Tuttavia l''utilizzo di Paypal prevede un costo aggiuntivo di commissione pari al 3% per i pagamenti effettuati da paesi dell''UE e del 6% per i pagamenti effettuati dal resto del mondo. ', 'GENERAL', 'it', 'Quali sono i metodi di pagamento che posso utilizzare per usufruire del vostro servizio?', 'metodo di pagamento');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (8, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'No, ma puoi utilizzare una carta di credito associata al tuo account PayPal.', 'GENERAL', 'it', 'E'' possibile pagare con carta di credito?', 'carta di credito');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (9, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Certamente: com Ã¨ multilingua e attivo in tutti i paesi. Per acquisti o vendite da e verso l''estero, dove cioÃ¨ i rischi di truffa sono maggiori, Ã¨ particolarmente raccomandato.', 'GENERAL', 'it', 'Posso utilizzare il servizio di com con partner fuori dall''Italia?', 'estero, europa');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (10, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dopo che ti sarai registrato, vai su "il mio sicuro" e seleziona "nuova transazione" nel link a sinistra. Segui poi le istruzioni.', 'TRANSACTION', 'it', 'Come faccio ad avviare una nuova transazione?', 'nuova transazione, avvio nuova transazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (11, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si, fino a un massimo di 10 transazioni simultaneamente.', 'TRANSACTION', 'it', 'E'' possibile avviare piÃ¹ transazioni simultaneamente?', 'nuova transazione, avvio nuova transazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (12, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Non Ã¨ possibile modificarla. Potrai perÃ² cancellarla fino a quando essa non sarÃ  stata accettata dal partner della transazione. Nel momento in cui egli avrÃ  accettato i tuoi termini della transazione, essi diverranno vincolanti sia per te che per l''atro partner. ', 'TRANSACTION', 'it', 'E'' possibile modificare una transazione appena avviata?', 'modifica transazione, cambia termini transazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (14, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si. Dopo aver visionato i termini della transazione potrai decidere se accettare o rifiutare.', 'TRANSACTION', 'it', 'E'' possibile rifiutare una transazione aperta da un altro utente?', 'rifiutare, annullare');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (15, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si. Avrai modo di scegliere il tuo ruolo all''avvio di ogni transazione.', 'TRANSACTION', 'it', 'E'' possibile avviare una transazione sia come acquirente che come venditore?', 'ruolo');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (16, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si, o meglio, dovrai pagare prima che la merce venga inviata,  sul conto fiduciario di com. Il pagamento da te effettuato resterÃ  bloccato finchÃ© non avrai ricevuto e verificato l''oggetto della transazione.', 'BUYER', 'it', 'Devo pagare in anticipo il venditore?', 'pagamenti, pagamento anticipato');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (17, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Il tempo di ispezione (espresso in giorni) viene definito all''avvio di ogni transazione. Quando crei o accetti una transazione, avrai modo di verificare e eventualmente modificare il tempo di ispezione stabilito.', 'BUYER', 'it', 'Quanto tempo avrÃ² a disposizione per verificare l''oggetto che mi Ã¨ stato spedito?', 'tempo di ispezione, ispezione, prova');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (18, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Certamente. Se ricevi un oggetto non conforme, avrai la possibilitÃ  di rispedirlo al venditore e ottenere il rimborso della somma da te versata o potrai aprire una contestazione. ', 'BUYER', 'it', 'La merce o il servizio che ho acquistato non Ã¨ conforme a quanto indicato dal venditore. Posso chiedere un rimborso?', 'non conforme, merce rovinata, pacco rotto');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (19, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Se il periodo di ispezione dovesse scadere senza che tu abbia preso una decisione o dato riscontro, considereremo l''oggetto come correttamente ricevuto.', 'BUYER', 'it', 'Ho dimenticato di informare com della corretta/erronea ricezione dell''oggetto della transazione, cosa succede?', 'non conforme, merce rovinata, pacco rotto');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (20, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dovrai attendere che l''acquirente riceva e verifichi l''oggetto da te spedito. Non appena l''oggetto ci risulterÃ  correttamente ricevuto e verificato, provvederemo a inoltrarti il pagamento della somma pattuita. ', 'SELLER', 'it', 'Ho spedito l''oggetto della transazione all''acquirente, cosa devo fare ora?', 'spedizione, trasferimento avvenuto, trasferimento effettuato');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (21, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dovrai attendere il termine del periodo di ispezione. Se il periodo di ispezione dovesse scadere senza che l''acquirente abbia preso una decisione, considereremo l''oggetto come correttamente accettato e ti invieremo il pagamento.', 'SELLER', 'it', 'Cosa devo fare se, dopo aver spedito l''oggetto della transazione all''acquirente, non ricevo alcuna risposta? ', 'tempo di ispezione, periodo di ispezione, ispezione, prova');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (22, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Secondo i termini della transazione, la responsabilitÃ  dell''oggetto spedito Ã¨ sempre a tuo carico. Non potremo effettuare il pagamento a tuo favore se l''oggetto non sarÃ  correttamente ricevuto dall''acquirente. Tu potrai perÃ² sempre rivolgerti per spiegazioni al corriere a cui hai affidato la spedizione. A questo proposito, consigliamo sempre di utilizzare spedizioni assicurate.', 'SELLER', 'it', 'Il corriere da me utilizzato ha smarrito l''oggetto della transazione. Come devo comportarmi? ', 'corriere');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (23, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Se l''acquirente dichiara di aver ricevuto un oggetto non conforme, avrÃ  10 giorni per riconsegnarlo (o, in caso di domini, per avviare la procedura di restituzione). Se trascorrono 10 giorni senza che l''acquirente abbia correttamente restituito l''oggetto della transazione, lo considereremo correttamente accettato.', 'SELLER', 'it', 'Cosa devo fare se l''acquirente rifiuta l''oggetto della transazione?', 'oggetto rifiutato, non conforme');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (24, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Contattaci, provvederemo a rimborsare l''acquirente della somma versata e a chiudere la transazione.', 'SELLER', 'it', 'Ho smarrito / non sono piÃ¹ in possesso dell''oggetto della transazione. Come devo comportarmi? ', 'smarrito, preso, perduto ');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (25, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Non appena l''acquirente ci confermerÃ  la corretta ricezione dell''oggetto della transazione o, in caso di mancata risposta dall''acquirente, non appena sarÃ  terminato il periodo di ispezione, provvederemo a inoltrarti il pagamento secondo la modalitÃ  da te selezionata.', 'SELLER', 'it', 'Quando potrÃ² ricevere il pagamento?', 'ricezione del pagamento, inoltro del pagamento');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (26, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'You can sign up to com both as a private or as a company.', 'GENERAL', 'en', 'Who can sign up to com?', 'registration, sign up, new account, user account');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (27, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Yes, the registration is completely free.', 'GENERAL', 'en', 'Is the registration free?', 'registration, sign up, new account, user account');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (28, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Of course, just tick the appropriate box during the registration. It will be possible to enter your company name and VAT.', 'GENERAL', 'en', 'Can I sign up as a professional user or company?', 'companies, VAT ');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (29, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Yes, you will be notified of the invoice at your email adress. You can also check "documents and invoices" in "my account" page in order to access the history of your invoices at any time.', 'GENERAL', 'en', 'Do I get an invoice at the end of the transaction?', 'invoice');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (30, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'In the sign up page, select the button "retrieve password" and you will immediately get a new password at your provided email adress. Then follow the instructions to set up a new password.', 'GENERAL', 'en', 'I forgot my password, how can i recover it?', 'password, retrieve password, password lost');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (31, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Go to "my account" page, then select "personal details" and edit the interested fields. Please note that you will not be able to edit the default payment options while the transaction is still in progress.', 'GENERAL', 'en', 'How do I change my personal informations?', 'personal info, personal data');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (32, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'com accepts wire transfers or PayPal payments. Please note that using PayPal has an additional costs of 3% from EU countries and 6% from rest of the world of the transaction price. ', 'GENERAL', 'en', 'What forms of payment does com accept?', 'method of payment, paymenty options');
